function ResultSummary(props) {
  const breed = props.breed;
  const result = props.result;

  delete result.id;
  delete result.breed;

  var maxNum = 0;
  var maxBreed = "";

  for (var i in result) {
    if (!(i === "breed" || i === "id")) {
      if (result[i] > maxNum) {
        maxNum = result[i];
        maxBreed = i;
      }
    }
  }
  console.log(maxNum);
  console.log(maxBreed);
  console.log(result);

  const element = (
    <div>
      <h1>
        {breed} 이름으로는 '{maxBreed}'가 가장 인기가 많아요.
      </h1>
    </div>
  );

  return element;
}

export default ResultSummary;
